Sisterhood (Digital Playground / WebDl / 2015)

The ladies of sorority Delta Pi Chi just moved into the neighborhood and the community is not thrilled! These sex-crazed sorority sisters party loud and screw louder with the fraternities without any consideration for their neighbors! Rush just started and a handful of horny freshman girls are eagerly waiting to pledge. The hazing gets kinky and the girls are constantly dropping to their knees to please, but it all pays off when the last ceremony, an all-girl orgy, seals them to the sisterhood! President Bella has one last party to throw, but if the girls get one more complaint, Delta Pi Chi is out. To ensure their fun, sheÃ¢â‚¬â„¢ll have to go deep into the system and sort things out!

